import React from 'react';
import './join_proposal_popup.css'; // Import your popup styling here

const JoinProposalPopup = ({ onClose }) => {
  return (
    <div className="join-proposal-popup">
      <span className='popuptitle'>Join Proposal</span>
      <input
          type="text"
          placeholder="전할 말을 작성해주세요."
          className="proposaltext input"
        />
      <button className='proposebutton' onClick={onClose}>참가 요청</button>
      <button className='closebutton' onClick={onClose}>Close</button>
    </div>
  );
};

export default JoinProposalPopup;
